script: |
  super -f text -I q5126.spq | sort > q5126.out

inputs:
  - name: q5126.spq
    data: |
      SELECT - 78 + + - col0 AS col1, - col1 FROM tab2 (FORMAT parquet) WHERE NOT + - col2 BETWEEN + 75 AND + - col2;
  - name: tab2

outputs:
  - name: q5126.out
    data: |
      -124	-51
      -142	-77
      -153	-67
